import { Container, } from "react-bootstrap";
import { Link } from "react-router-dom";



const Index = () => {
  return (
    <div className="indexBack">
      <Container>
        <section>
          <h1>El Calvo de la Lotería</h1>
          <p>
            Ver los <Link to="/results"> resultados de la semana </Link>
          </p>
          <p>
            Si quiere realizar un pedido de lotería o jugar a los diferentes sorteos semanales haga  
            <Link to="/results"> resultados de la semana </Link>
          </p>
          <p>
            Para mas información <Link to="/contact"> contacte </Link> con
            nosotros
          </p>
        </section>
      </Container>
    </div>
  );
};

export default Index;
